import React from "react";
import gretchpic from "../Images/gretchpic.JPG";

function About() {
    return (
    <div className="App">
      <div className="App-header">
        <span className="about-container">
          <div className="row">
            <div className="col-sm-3">
              <img src={gretchpic} className="Gretchen-Image" alt="Gretchen's headshot" />
            </div>   
            <div className="col-sm-9">
              <div className="about-container-text">
                <h2 id="about-header">Hello there!</h2>
                <p id="about-text">Full stack web developer leveraging experience in sales and customer service to build a better and more responsive user experience. Recently earned a professional certificate in full stack coding from Butler University, with recently developed skills in React, JavaScript, Css, and website responsiveness. Interested in expanding knowledge and experience to grow into a successful career in UX/UI design.</p>
                </div>
            </div>
          </div>
        </span>
      </div>
    </div>
  );
}

export default About;
